var commands=[new command("help",function(){var a="Commands :";for(var b=0;b<commands.length;b++){a+="\n"+commands[b].name}return a}),new command("clear",function(){calculatorOutput.textContent="";return""}),new command("log",function(){return errorLog}),new command("tree",function(){window.open("tree.html","Tree");return"Opening tree..."})];function command(a,b){this.name=a;this.action=b}window.onload=function(){var b=document.getElementById("calculatorInput");var a=document.getElementById("calculatorOutput");b.onkeyup=function(e){if(e.keyCode!==13){return}var c=null;for(var d=0;d<commands.length;d++){if(commands[d].name===b.value){c=commands[d].action();break}}if(c===null){if(b.value===""){b.value="0"}result=calculate(b.value);if(result===null){c="ERR = "+b.value}else{c=result+" = "+b.value;b.value=result}}a.textContent=c+(a.textContent===""?"":"\n")+a.textContent}};